from collections import defaultdict

class Solution:
    def findTheLongestSubstring(self, s: str) -> int:
        N = len(s)
        hsh = {x: 2**y for x, y in zip('aeiou', range(5))}
        pfx = [0 for _ in range(N)]
        for i, v in enumerate(s):
            val = hsh[v] if v in hsh else 0
            if i == 0:
                pfx[i] = val
            else:
                pfx[i] = pfx[i-1] ^ val
        #print(pfx)
        pos = defaultdict(list)
        res = 0
        for i, v in enumerate(pfx):
            #print(i, v, pos, res)
            if v == 0:
                res = max(res, i+1)
            else:
                if v in pos:
                    res = max(res, i - pos[v][0])
            if v > 0:
                pos[v] += [i]
        return res

